import React from 'react';

export default function VisitsHeader() {
    return (
        <div>
            <ul >
                <li>Visiteurs</li>
                <li>Personne rencontrée</li>
                <li>Entreprise</li>
                <li>Motif visite</li>
                <li>Entrée</li>
                <li>Sortie</li>
            </ul>
        </div>
    );
}
